import React from "react";
import Athlete from "./Athlete";



export const data = {
    "Name": "Athlete-Name",
    "Date": "Date",
    "averageScore": {
        "Monday": "dataMonday",
        "Tuesday": "dataTuesday",
        "Wednesday": "dataWednesday",
        "Thursday": "dataThursday",
        "Friday": "dataFriday",
        "Saturday": "dataSaturday",
        "Sunday": "dataSunday"
    },
    "weeklyAverage": 0
}

App.defaultProps = {data}

function App({data}){
    return(
    <div>
        <Athlete props={data}/>
    </div>
    )
}

export default App;
